import React, { Component } from 'react';
import Slider from "react-slick";
import { BsChevronLeft, BsChevronRight } from "react-icons/bs";

export default class MultipleItems extends Component {
    render() {
      const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 1
      };
      return (
        <div className="container">
          <Slider {...settings}>
          <div><Link to="/babynamefinder">
                  <img src={babyname} alt="logo" width="200" height="200"/>
                 </Link></div>
          <div><Link to="/babynamefinder">
                  <img src={ovulation} alt="logo" width="200" height="200"/>
                 </Link></div>
          <div><Link to="/babynamefinder">
                  <img src={growth} alt="logo" width="200" height="200"/>
                 </Link></div>
          <div><Link to="/babynamefinder">
                  <img src={duedate} alt="logo" width="200" height="200"/>
                 </Link></div>
          <div><Link to="/babynamefinder">
                  <img src={babyname} alt="logo" width="200" height="200"/>
                 </Link></div>
          <div><Link to="/babynamefinder">
                  <img src={babyname} alt="logo" width="200" height="200"/>
                 </Link></div>
          </Slider>
        </div>
      );
    }
  }
